import { useState } from "react";

export default function App() {
  return (
    <div className="container">
      <div className="card">
        <h1> Apps</h1>
        <hr class="firsthr" />
        <Listapp />
        <Button />
      </div>
    </div>
  );
}
function Listapp() {
  const [toggle, setToggle] = useState(false);
  function handletoggle() {
    setToggle((tg) => !tg);
  }

  return (
    <div className="app">
      <div
        className={toggle ? "toggle" : "first one-name"}
        onClick={handletoggle}
      >
        <i
          className="fa-brands fa-slack fa-spin-pulse"
          style={{ color: "#63E6BE" }}
        ></i>
        <p>Slack</p>
      </div>

      <div className={" second one-name"}>
        <i className="fa-brands fa-trello" style={{ color: "#74C0FC" }}></i>
        <p>Trello</p>
      </div>

      <div className="third one-name">
        <i className="fa-brands fa-discord" style={{ color: "#B197FC" }}></i>
        <p>Discord</p>
      </div>

      <div className="fouth one-name">
        <i className="fa-brands fa-linkedin"></i>
        <p>linkedin</p>
      </div>

      <div className="fith one-name">
        <i className="fa-brands fa-github"></i>
        <p>Github</p>
      </div>

      <div className="fith one-name">
        <i className="fa-brands fa-google"></i>
        <p>Google</p>
      </div>
    </div>
  );
}
function Button() {
  return (
    <>
      <br />
      <hr />

      <button>Add More Apps</button>
    </>
  );
}
